import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Cards from '../Cards';
import Footer from '../Footer';
import Type from '../Type';

function Home () {
    return (
        <>
                                <Col className="home-header" style = {{textAlign: "center"}}>
                            <Type style = {{width:"100%"}}/>
                        </Col>
        <HeroSection />
        <Cards />
        <Footer />
        </>
    );
}

export default Home;
